import { Checkbox, TextField } from "@mui/material";
import React from "react";
import styled from "styled-components";

const NotificationTabView = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;

const SelectView = styled.div``;

const NotificationTab = () => {
  const listNottab = [
    "Submit timesheet",
    "Request Off/Remote/Onsite/Đi muộn, về sớm",
    "Approve/Reject Request Off/Remote/Onsite/Đi muộn, về sớm",
    "Request Change Working Time",
    "Approve/Reject Change Working Time",
  ];
  return (
    <NotificationTabView>
      <TextField fullWidth variant="standard" label={"Komu Channel Id"} />
      <SelectView>
        {listNottab.map((notTab) => {
          <Checkbox
            sx={{
              "&.Mui-checked": {
                color: "#f24b50",
              },
            }}
            style={{ paddingLeft: 0 }}
          />;
          return <div>{notTab}</div>;
        })}
      </SelectView>
      {/* <SelectView>
        <Checkbox
          sx={{
            "&.Mui-checked": {
              color: "#f24b50",
            },
          }}
          style={{ paddingLeft: 0 }}
        />
        <strong>Gửi thông báo đến Komu</strong>
      </SelectView> */}
    </NotificationTabView>
  );
};

export default NotificationTab;
